- input: "TEXT\x1CC00239947\x1C1\x1C\x1CF3XA\x1CCaesars Entertainment Political Action
    Committee is in receipt of your Request for Additional Information sent on January
    22, 2013. With respect to the amended September Monthly report, the most up-to-date
    beginning cash on hand balance was not used after an incorrect beginning cash
    on hand balance was used in filing the amended August monthly report.  This caused
    the calculation error on Line 8, which has now been corrected. With regard to
    the additional receipts disclosed on the amended September report, payroll receipts
    were inadvertently undisclosed.  Steps have now been taken to ensure that all
    payroll data will be included on reports going forward in 2013. This report is
    also being amended to disclose $54.90 in disbursements on Line 21(b) for bank
    fees that had been inadvertently undisclosed.  \n"
